import React, { useState, useEffect } from "react";
import logo from './logo.svg';
import './App.css';
// import

function App() {
    const [currTime, setCurrTime] = useState(0);
    useEffect(() => {
        fetch('/index').then(res => res.json()).then(data => {
            setCurrTime(data.time);
        });
    }, []);

  return (
    <div className="App">
      {/*<header className="App-header"></header>*/}
      {/*<p>lol: {currTime}</p>*/}
        <table>
            <thead>
            <tr>
                <th>Anton</th>
                <th>Max</th>
                <th>Sonya</th>
            </tr>
            </thead>
        </table>
    </div>
  );
}

export default App;
